import React from "react";
import Gambar from "../images/strange.jpg";

const Content = () => {
  return (
    <div className="flex flex-col justify-center items-center bg-gradient-to-r from-pink-500 via-red-500 to-yellow-500 h-screen font-mono py-40">
      <img src={Gambar} alt="brian" className="h-full rounded mb-20 shadow" />
      <div className="flex flex-col justify-center items-center">
        <h2 className="text-2xl mb-2">Brian Vidyanjaya</h2>
      </div>
    </div>
  );
};

export default Content;
